package y_p;

import java.util.Scanner;

public class y_1285 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner cin = new Scanner(System.in);
		while(cin.hasNext()) {
			int n = cin.nextInt();
			int i;
			for(i = 1; i <= n; i++) {
				System.out.println(i);
			}
		}
		cin.close();
	}

}
